import {Link, useNavigate} from 'react-router-dom';
const Home =(props)=>{

    const navigate = useNavigate();
    const goAbout =()=>{
        navigate("/about");
    }
    return(
        <>
            <button onClick={goAbout}>GO ABOUT</button>
            <p>THIS IS HOME!</p>
            <p><Link to={"/"}>HOME</Link></p>
            <p><Link to={"/about"}>ABOUT</Link></p>
        </>
    );
}
export default Home;
